import React from 'react';

export default function ChildCallbackHookExample({ }) {
    const increment5 = useCallback(() => {
        console.log("increment5");
        setCount5((prev) => prev + 5);
    }, [count5])

    return (
        <>
            <button onClick={increment5}>Increment +{count5}</button>
        </>
    );
}
